import styled from "styled-components"

export const Container = styled.body`
    background: #FFFFFF;
`;

export const HeaderButtonLeft = styled.button`
    top: 18px;
    margin-left: 10px;
    left: 10px;
    position: absolute;
    border-radius: 10px;
    border: none;
`;

export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    position: absolute;
    border-radius: 10px;
    top: 18px;
    border: none;
`;

export const Title = styled.h1`
    position: relative;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    top: 16px;
    left: 130px;
`;

export const Container1 = styled.div`
    position: absolute;
    height: 90px;
    width: 315px;
    left: 30px;
    top: 102px;
    border-radius: 20px;
    background: #FF0000;
    opacity: 0.1;
`;

export const Text1 = styled.text`
    position: absolute;
    height: 18px;
    width: 62px;
    left: 115px;
    top: 126px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #FF0000;
    opacity: 0.8;
`;

export const Text2 = styled.text`
    position: absolute;
    height: 21px;
    width: 188px;
    left: 115px;
    top: 147px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 500;
    font-size: 14px;
    line-height: 21px;
    color: #1D1617;
`;

export const Container2 = styled.div`
    position: absolute;
    height: 137px;
    width: 315px;
    left: 30px;
    top: 212px;
    border-radius: 22px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    opacity: 0.2;
    border-radius: 22px;
`;

export const Text3 = styled.text`
    position: absolute;
    height: 36px;
    width: 165px;
    left: 50px;
    top: 238px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 500;
    font-size: 12px;
    line-height: 18px;
    color: #1D1617;
`;

export const Container3 = styled.div`
    position: absolute;
    height: 35px;
    width: 95px;
    left: 50px;
    top: 289px;
    border-radius: 50px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
`;

export const Text4 = styled.text`
    position: absolute;
    height: 15px;
    width: 57px;
    left: 69px;
    top: 299px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 600;
    font-size: 10px;
    line-height: 15px;
    color: #FFFFFF;
`;

export const Container4 = styled.div`
    position: absolute;
    height: 57px;
    width: 315px;
    left: 30px;
    top: 379px;
    border-radius: 16px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    opacity: 0.2;
`;

export const Text5 = styled.text`
    position: absolute;
    height: 21px;
    width: 138px;
    left: 50px;
    top: 397px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 500;
    font-size: 14px;
    line-height: 21px;
    color: #1D1617;
`;

export const Container5 = styled.div`
    position: absolute;
    height: 28px;
    width: 88px;
    left: 237px;
    top: 394px;
    border-radius: 50px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
`;

export const Text6 = styled.text`
    position: absolute;
