    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #FFFFFF;
`;

export const Text7 = styled.text`
    position: absolute;
    width: 59px;
    height: 24px;
    left: 30px;
    top: 466px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 600;
    font-size: 16px;
    line-height: 24px;
    color: #1D1617;
`;

export const Text8 = styled.text`
    position: absolute;
    width: 58px;
    height: 18px;
    left: 287px;
    top: 469px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 500;
    font-size: 12px;
    line-height: 18px;
    color: #ADA4A5;
`;

export const Text9 = styled.text`
    position: absolute;
    width: 40px;
    height: 18px;
    left: 30px;
    top: 505px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #7B6F72;
`;

